import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, FormArray, Validators } from '@angular/forms';


@Component({
  selector: 'app-crear-cliente',
  templateUrl: './crear-cliente.component.html',
  styleUrls: ['./crear-cliente.component.css']
})
export class CrearClienteComponent implements OnInit {

  clienteForm: FormGroup;

  constructor(private fb: FormBuilder) {
    this.clienteForm = this.fb.group({
      nombre: ['', Validators.required],
      email: ['', [Validators.required, Validators.email]],
      telefono: ['', Validators.required],
      otrosDatos: ['', Validators.required],
      direcciones: this.fb.array([]) // FormArray para múltiples direcciones
    });
  }

  ngOnInit(): void {
    // Iniciar con una dirección vacía
    this.addDireccion();
  }

  // Getter para acceder al FormArray de direcciones
  get direcciones(): FormArray {
    return this.clienteForm.get('direcciones') as FormArray;
  }

  // Método para agregar una nueva dirección
  addDireccion() {
    const direccionForm = this.fb.group({
      calle: ['', Validators.required],
      sector: ['', Validators.required],
      provincia: ['', Validators.required],
      pais: ['', Validators.required]
    });
    this.direcciones.push(direccionForm);
  }

  // Método para eliminar una dirección
  removeDireccion(index: number) {
    this.direcciones.removeAt(index);
  }

  // Método para guardar el cliente con direcciones
  saveCliente() {
    if (this.clienteForm.valid) {
      console.log(this.clienteForm.value);
      // Lógica para guardar el cliente y sus direcciones
    }
  }
}
<div class="container mt-4">
  <form [formGroup]="clienteForm" (ngSubmit)="saveCliente()">
    <div class="mb-3">
      <label for="nombre" class="form-label">Nombre</label>
      <input id="nombre" type="text" class="form-control" formControlName="nombre">
    </div>

    <div class="mb-3">
      <label for="email" class="form-label">Email</label>
      <input id="email" type="email" class="form-control" formControlName="email">
    </div>

    <div class="mb-3">
      <label for="telefono" class="form-label">Teléfono</label>
      <input id="telefono" type="text" class="form-control" formControlName="telefono">
    </div>

    <div class="mb-3">
      <label for="Otros" class="form-label">Otros Datos</label>
      <input id="Otros" type="text" class="form-control" formControlName="Otros">
    </div>

    <h4>Direcciones</h4>

    <div formArrayName="direcciones">
      <div *ngFor="let direccion of direcciones.controls; let i = index" [formGroupName]="i" class="card mb-3">
        <div class="card-body">
          <div class="mb-3">
            <label for="calle-{{i}}" class="form-label">Calle</label>
            <input id="calle-{{i}}" type="text" class="form-control" formControlName="calle">
          </div>

          <div class="mb-3">
            <label for="sector-{{i}}" class="form-label">Sector</label>
            <input id="sector-{{i}}" type="text" class="form-control" formControlName="sector">
          </div>

          <div class="mb-3">
            <label for="provincia-{{i}}" class="form-label">Provincia</label>
            <input id="provincia-{{i}}" type="text" class="form-control" formControlName="provincia">
          </div>

          <div class="mb-3">
            <label for="pais-{{i}}" class="form-label">País</label>
            <input id="pais-{{i}}" type="text" class="form-control" formControlName="pais">
          </div>

          <button type="button" class="btn btn-danger" (click)="removeDireccion(i)">
            Eliminar dirección
          </button>
        </div>
      </div>
    </div>

    <button type="button" class="btn btn-primary mb-3" (click)="addDireccion()">
      + Agregar Dirección
    </button>

    <button type="submit" class="btn btn-success">Guardar Cliente</button>
  </form>
</div>
